import React from "react";

const CollectionPreview = ({title, items}) => {
  return <div>
      <h1>{ title}</h1>
      {items.map(({id,title,price}) => 
        <h1 key={id}>{title} {price}</h1> )}
  </div>;
};
export default CollectionPreview;
